import './App.css';
import glass from './images/glass.png'
import basket from './images/basket.png'

function App() {
  return (
    <div className="App">
      <div className="marcet">
        <div className="marcet__header">
          <div className="marcet__header__block">
            <div className="marcet__header__block--text">MARCET</div>
          </div>
          <div className="marcet__header__search"><img alt='лупа' src={glass} /> <input /></div>
          <div className="marcet__header__basket"><img alt='корзина' src={basket} /></div>
        </div>
      </div>
    </div>
  );
}

export default App;
